import React from "react";

function App() {
  const handleLogin = () => {
    window.location.href = "http://localhost:8080/api/auth/login";
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to GamerHub</h1>
      <button
        onClick={handleLogin}
        style={{
          padding: "10px 20px",
          fontSize: "16px",
          cursor: "pointer",
          backgroundColor: "#0078D7",
          color: "#ffffff",
          border: "none",
          borderRadius: "5px",
        }}
      >
        Login with Xbox
      </button>
    </div>
  );
}

export default App;
